	 */
	public Card getTarget() {
		return target;
	}
	
	/**
	 * Gets the zone that the targeted card is in
	 * @return the zone occupied by the card that this stack item is targeting
	 */
	public Zone getTargetZone() {
		return targetZone;
	}
}

